import React from 'react';
import './App.css';
import NavigationBar from './Components/NavigationBar';
import {Route, Routes} from 'react-router-dom'
import Home from '../../front/src/Pages/Home';
import Admin from '../../front/src/Pages/Admin';
import AnnonceDetail from '../../front/src/Pages/AnnonceDetail';
import Annonces from '../../front/src/Pages/Annonces';
import Login from '../../front/src/Pages/Login';
import Register from '../../front/src/Pages/Register';
import Profile from '../../front/src/Pages/Profile';
import Error from '../../front/src/Pages/Error';

function App() {
  return (
    <div className="App">
      <h1>SELL&BUY</h1>
      <NavigationBar />
      <Routes>
        <Route path='/' element={<Home/>} />
        <Route path='/admin' element={<Admin/>} />
        <Route path='/annonceDetail' element={<AnnonceDetail />} />
        <Route path='/annonces' element={<Annonces />} />
        <Route path='/login' element={<Login />} />
        <Route path='/register' element={<Register />} />
        <Route path='/profile' element={<Profile />} />
        <Route path='/*' element={<Error />} />
        <Route path="/admin" element={<Admin />} />
      </Routes>
    </div>
  );
}

export default App;
